import React from 'react';
import List from './components/List';

import './App.css';

class App extends component {

  state = {
    list: [
      {
        id: 1,
        place: 'El paellero',
        reserved: false
      },
      {
        id: 2,
        place: 'El pueblo',
        reserved: false
      },
      {
        id: 3,
        place: 'Casa enrique',
        reserved: false
      },
    ]
  }
 render(){
  return (
    <div className="App">
     <List list={this.state.list}/>
    </div>
  );
}
}

export default App;
